#pragma mark - Table view data source

- (NSInteger)tableView:(UITableView *)tableView numberOfRowsInSection:(NSInteger)section
{
    // Return the number of rows in the section.
    if (tableView == self.searchDisplayController.searchResultsTableView) {
        return self.searchResults.count;
    } else {
        return [self classData].count;
    }
}

- (void)tableView:(UITableView *)tableView didSelectRowAtIndexPath:(NSIndexPath *)indexPath
{
    NSDictionary *class;
    if (tableView == self.searchDisplayController.searchResultsTableView) {
        class = [self searchResults][indexPath.row];
    } else {
        class = [self classData][indexPath.row];
    }
    [self.navigationController dismissViewControllerAnimated:YES completion:nil];
    [self.delegate didDismissWithBuildingChoice:[class[@"BuildingId"] integerValue]];
}

- (UITableViewCell *)tableView:(UITableView *)tableView cellForRowAtIndexPath:(NSIndexPath *)indexPath
{
    NSString *cellId = @"classRow";
    
    UITableViewCell *cell = [tableView dequeueReusableCellWithIdentifier:cellId];
    if (!cell) {
        cell = [[UITableViewCell alloc] initWithStyle:UITableViewCellStyleValue1 reuseIdentifier:cellId];
    }
    
    NSDictionary *class;
    if (tableView == self.searchDisplayController.searchResultsTableView) {
        class = [self searchResults][indexPath.row];
    } else {
        class = [self classData][indexPath.row];
    }
    cell.textLabel.text = [NSString stringWithFormat:@"%@%@-%@", class[@"Subject"], class[@"Catalog"], class[@"Section"]];
    cell.detailTextLabel.text = [NSString stringWithFormat:@"%@ %@", class[@"Building"], class[@"Room"]];
    
    return cell;
}

#pragma mark - UISearchDisplayController

- (void)filterContentForSearchText:(NSString*)searchText scope:(NSString*)scope
{
    NSPredicate *resultPredicate = [NSPredicate predicateWithFormat:@"Search contains[c] %@", searchText];
    self.searchResults = [[self classData] filteredArrayUsingPredicate:resultPredicate];
    SSULogDebug(@"Filtered %lu object(s) down to %lu", (unsigned long)[self classData].count, (unsigned long)self.searchResults.count);
}

-(BOOL)searchDisplayController:(UISearchDisplayController *)controller shouldReloadTableForSearchString:(NSString *)searchString
{
    [self filterContentForSearchText:searchString
                               scope:[[self.searchDisplayController.searchBar scopeButtonTitles]
                                      objectAtIndex:[self.searchDisplayController.searchBar
                                                     selectedScopeButtonIndex]]];
    
    return YES;
}

- (IBAction)cancelTapped:(id)sender {
    [self.navigationController dismissViewControllerAnimated:YES completion:nil];
    [self.delegate didDismissWithBuildingChoice:NSNotFound];
}

